import React from 'react';
import './App.css';
import TodoForm from './components/TodoForm.js';

class App extends React.Component {
  state = {
    todos: [
      { id: 1, task: 'Walk the dog', done: false },
      { id: 2, task: 'Water the flower', done: true }
    ]
  }

  render() {

    return (
      <div className="App" >

        <TodoForm
        />

      </div>
    );

  }
}

export default App;
